import ReactDOM from "react-dom";
import React, { Component } from "react";

export default class Row extends Component<{
  children?: React.Node
}> {
  render() {
    return (
      <div className="row justify-content-center align-items-center">
        {this.props.children}
      </div>
    );
  }
}
